import React from "react";
import "./about-content.css";

function AboutContent() {
  return (
    <div className="about-content-container">
      <p className="about-content">
        I am Onur Emre YILDIRIM, a computer engineering student and freelance
        software developer. I have been working with flutter for mobile
        application, React and NodeJS for web application about 2 years.
      </p>
      <p className="about-content-2"></p>
    </div>
  );
}

export default AboutContent;
